import React from 'react';

export default class Hi extends React.Component {
  render() {
    return (
      <div className='hi'>
        <h1> {this.props.match.params.name}</h1>

        <img
          src={this.props.imgP[this.props.history.location.index].img}
          alt='todo for another'
          style={{
            display: 'block',
            width: '100%',
          }}
        />
        <h2>{this.props.name}</h2>
      </div>
    );
  }
}
